import React from "react";
import "./uploader.css";

export default function Uploader() {
  function fileHandler(e) {
    console.log(e.target.files);
  }
  return (
    <div className="box-upload">
      <span> Upload Your Resume </span>
      <input
        className="add-btn"
        type="file"
        name="myFile"
        onChange={fileHandler}
      />
    </div>
  );
}
